INSERT INTO `v1_721c0e2912fa05228bd75bc9e15d6eb8d9189ef98fa8079a9b04d2f2e86fe700` VALUES (11, 0, 103311, "オラの食材とあんちゃんの腕……\nこれは二人の共同作業ってことに……\nな、なんでもねぇ！\n気にしねぇでけろ！", 1, 5, 1, 0, 1033501, "", 1033501043);
INSERT INTO `v1_721c0e2912fa05228bd75bc9e15d6eb8d9189ef98fa8079a9b04d2f2e86fe700` VALUES (91, "", 0, "", "", "", "", "", 1033501, "", 1033501044);
