INSERT INTO `v1_721c0e2912fa05228bd75bc9e15d6eb8d9189ef98fa8079a9b04d2f2e86fe700` VALUES (11, 0, 103311, "それにしても食べるのが\nもったいねぇいいケーキだなぁ……\nでも食べなきゃ食べねぇで\nもったいねぇよなぁ……", 1, 6, 1, 0, 1033501, "", 1033501046);
INSERT INTO `v1_721c0e2912fa05228bd75bc9e15d6eb8d9189ef98fa8079a9b04d2f2e86fe700` VALUES (91, "", 0, "", "", "", "", "", 1033501, "", 1033501047);
INSERT INTO `v1_721c0e2912fa05228bd75bc9e15d6eb8d9189ef98fa8079a9b04d2f2e86fe700` VALUES (21, "", "vo_adv_1033501", "vo_adv_1033501_003", "", 0, 0, "", 1033501, "", 1033501048);
INSERT INTO `v1_721c0e2912fa05228bd75bc9e15d6eb8d9189ef98fa8079a9b04d2f2e86fe700` VALUES (11, 0, 103311, "うーん……\nオラ一人で食べるのも申し訳ねぇし\nエリザベスパークのみんなで\n食べるべか！", 1, 6, 1, 0, 1033501, "", 1033501049);
INSERT INTO `v1_721c0e2912fa05228bd75bc9e15d6eb8d9189ef98fa8079a9b04d2f2e86fe700` VALUES (91, "", 0, "", "", "", "", "", 1033501, "", 1033501050);
