INSERT INTO `v1_721c0e2912fa05228bd75bc9e15d6eb8d9189ef98fa8079a9b04d2f2e86fe700` VALUES (11, 0, 103411, "わあ……素敵なケーキね！\nえ？　キミが作ったの？\nすごいじゃない！", 1, 4, 1, 0, 1034501, "", 1034501040);
