INSERT INTO `v1_721c0e2912fa05228bd75bc9e15d6eb8d9189ef98fa8079a9b04d2f2e86fe700` VALUES (11, 0, 111011, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 1, 4, 1, 0, 1110501, "", 1110501043);
