INSERT INTO `v1_721c0e2912fa05228bd75bc9e15d6eb8d9189ef98fa8079a9b04d2f2e86fe700` VALUES (11, 0, 111011, "是非もなし。\n端的に言えば、先輩ちょっと感激した。\n今宵は飲めや食えやの大騒ぎだ。\n朝まで踊り明かすぜ同志、ヒャッハー！", 1, 5, 1, 0, 1110501, "", 1110501052);
